import { createApp, onBeforeMount, ref, shallowRef } from 'vue';
import { AgGridVue } from 'ag-grid-vue3';
import 'ag-grid-charts-enterprise';
import 'ag-grid-community/styles/ag-grid.css';
import 'ag-grid-community/styles/ag-theme-quartz.css';
import { FakeServer } from './fakeServer.js';



const VueExample = {
    template: `
        <div style="height: 100%">
                <ag-grid-vue
      style="width: 100%; height: 100%;"
      :class="themeClass"
      :columnDefs="columnDefs"
      @grid-ready="onGridReady"
      :defaultColDef="defaultColDef"
      :autoGroupColumnDef="autoGroupColumnDef"
      :serverSideOnlyRefreshFilteredGroups="true"
      :rowModelType="rowModelType"
      :cacheBlockSize="cacheBlockSize"></ag-grid-vue>
        </div>
    `,
    components: {
        'ag-grid-vue': AgGridVue,

    },
    setup(props) {
        const columnDefs = ref([{field:"country",
rowGroup:true,
hide:true},{field:"sport",
rowGroup:true,
hide:true},{field:"year",
minWidth:100,
filter:"agNumberColumnFilter",
floatingFilter:true},{field:"gold",
aggFunc:"sum",
filter:"agNumberColumnFilter",
floatingFilter:true,
enableValue:true},{field:"silver",
aggFunc:"sum",
filter:"agNumberColumnFilter",
floatingFilter:true,
enableValue:true},{field:"bronze",
aggFunc:"sum",
filter:"agNumberColumnFilter",
floatingFilter:true,
enableValue:true}]);
        const gridApi = shallowRef();
        const defaultColDef = ref({
    flex: 1,
    minWidth: 120,
});
        const autoGroupColumnDef = ref(null);
const rowModelType = ref(null);
const cacheBlockSize = ref(null)

        onBeforeMount(() => {
            autoGroupColumnDef.value = {
    flex: 1,
    minWidth: 280,
    field: 'athlete',
};
rowModelType.value = 'serverSide';
cacheBlockSize.value = 5            
        });

        const onGridReady = (params) => {

        gridApi.value = params.api;



            const updateData = (data) => {
    // setup the fake server with entire dataset
    var fakeServer = new FakeServer(data);
    // create datasource with a reference to the fake server
    var datasource = getServerSideDatasource(fakeServer);
    // register the datasource with the grid
    params.api.setGridOption('serverSideDatasource', datasource);
};

            fetch('https://www.ag-grid.com/example-assets/olympic-winners.json')
                .then(resp => resp.json())
                .then(data => updateData(data));
    };

        return {
            columnDefs,
            gridApi,
            defaultColDef,
autoGroupColumnDef,
rowModelType,
cacheBlockSize,
            onGridReady,
            themeClass: /** DARK MODE START **/document.documentElement.dataset.defaultTheme || 'ag-theme-quartz'/** DARK MODE END **/,

        }        
    }
}

window.getServerSideDatasource = function getServerSideDatasource(server) {
    return {
        getRows: (params) => {
            console.log('[Datasource] - rows requested by grid: ', params.request);
            var response = server.getData(params.request);
            // adding delay to simulate real server call
            setTimeout(() => {
                if (response.success) {
                    // call the success callback
                    params.success({ rowData: response.rows, rowCount: response.lastRow });
                }
                else {
                    // inform the grid request failed
                    params.fail();
                }
            }, 1000);
        },
    };
}

createApp(VueExample)
    .mount("#app")

